# 测试脚本使用方法
# python test.py --bin {你的cpu可执行文件路径}
# 如果你的cpu可执行文件路径是sim/sim，那么就是python test.py --bin sim/sim
# 如果你的cpu需要解释器，那么就是python test.py --bin "python3 sim/sim.py"


import os
import shutil
import yaml
import json
import argparse
import subprocess
import difflib


def main(test, answer):
    # 3步:
    # 1. 把test写到temp_test文件夹内
    # 2. 用可执行文件，把temp_test文件夹内的文件跑一遍，把结果写到temp_answer文件夹内
    # 3. 把temp_answer文件夹内的文件读出来，和answer相比较
    args = parse_args()
    os.makedirs('temp_test', exist_ok=True)
    os.makedirs('temp_answer', exist_ok=True)
    for filename, content in test.items():
        with open(f"temp_test/{filename}", 'w') as f:
            f.write(content)
    for filename in os.listdir('temp_test'):
        testname = filename.split('.')[0]
        try:
            # import ipdb; ipdb.set_trace()
            subprocess.run(args.bin.split(" "), stdin=open(f"temp_test/{filename}"), stdout=open(f"temp_answer/{testname}", 'w'), timeout=1)
        except Exception as e:
            print(f"Execution failed: {e}")
            return
    #return


    def try_read(file):
        # try to read it as json, if failed, try to read it as yaml
        try:
            with open(file) as f:
                return json.load(f)
        except:
            try:
                with open(file) as f:
                    return yaml.safe_load(f)
            except:
                print(f"Failed to read json or yaml: {file}")
                return None
            
    res = {file: try_read(f"temp_answer/{file}") for file in os.listdir('temp_answer')}
    if not args.save_mid:
        shutil.rmtree('temp_test')
        shutil.rmtree('temp_answer')
    def transform_mem(states):
        for state in states:
            assert isinstance(state, dict) and 'MEM' in state, f"Parse Error, your answer: \n{states}"
            state['MEM'] = {str(k): v for k, v in state['MEM'].items()}
        return states
    for filename, content in res.items():
        rc = transform_mem(content)
        ra = transform_mem(answer[filename])
        if rc != ra:
            print(f"Wrong answer for {filename}")
            print(f"Your answer: \n{rc}")
            print(f"Correct answer: \n{ra}")
            print("Diff:")
            print(diff_strings(str(rc), str(ra)))
            return
    print("All correct!")

# https://gist.github.com/ines/04b47597eb9d011ade5e77a068389521
def diff_strings(a: str, b: str, *, use_loguru_colors: bool = False) -> str:
    output = []
    matcher = difflib.SequenceMatcher(None, a, b)
    if use_loguru_colors:
        green = '<GREEN><black>'
        red = '<RED><black>'
        endgreen = '</black></GREEN>'
        endred = '</black></RED>'
    else:
        green = '\x1b[38;5;16;48;5;2m'
        red = '\x1b[38;5;16;48;5;1m'
        endgreen = '\x1b[0m'
        endred = '\x1b[0m'

    for opcode, a0, a1, b0, b1 in matcher.get_opcodes():
        if opcode == 'equal':
            output.append(a[a0:a1])
        elif opcode == 'insert':
            output.append(f'{green}{b[b0:b1]}{endgreen}')
        elif opcode == 'delete':
            output.append(f'{red}{a[a0:a1]}{endred}')
        elif opcode == 'replace':
            output.append(f'{green}{b[b0:b1]}{endgreen}')
            output.append(f'{red}{a[a0:a1]}{endred}')
    return ''.join(output)

def parse_args():
    parser = argparse.ArgumentParser()
    parser.add_argument('--bin', type=str, help='path to the executable file',required=True)
    parse_args
    parser.add_argument('--save_mid',action='store_true',help='save the intermediate files')
    return parser.parse_args()

def read_file(file):
    if file.endswith('.yaml'):
        with open(file) as f:
            return yaml.safe_load(f)
    elif file.endswith('.json'):
        with open(file) as f:
            return json.load(f)
    else:
        raise Exception(f"Unknown file type: {file}")

# Only for development
def generate_answer():
    os.chdir('sim')
    os.system('make clean')
    os.system('make')
    assert os.path.exists('sim')
    os.chdir('..')
    os.makedirs('answer', exist_ok=True)
    for file in os.listdir('test'):
        os.system(f"sim/sim test/{file} > answer/{file.split('.')[0]}.yaml")
    res = {}
    for file in os.listdir('answer'):
        res[file.split('.')[0]] = read_file(f"answer/{file}")
    with open('answer.py', 'w') as f:
        f.write(f"answer = {res}")
    shutil.rmtree('answer')
        
